import React from "react";

const CHICKEN_GIF = "https://media.giphy.com/media/3o6Zt481isNVuQI1l6/giphy.gif";
const NUM_CHICKENS = 5;

const ChickenRow: React.FC = () => (
  <div className="chicken-row">
    {Array.from({ length: NUM_CHICKENS }).map((_, i) => (
      <img
        key={i}
        src={CHICKEN_GIF}
        alt="Walking chicken"
        className="chicken"
        style={{ animationDelay: `${i * 1.5}s` }}
      />
    ))}
  </div>
);

export default ChickenRow;
